  const [activeSection, setActiveSection] = useState("menu");

  return (
    <div className="dashboard-container">
      <NavBar
        menu={menu}
        setMenu={setMenu}
        orders={orders}
        setOrders={setOrders}
      />
      <h2>Hotel Admin Dashboard</h2>
   
    </div>
  );
};

export default Dashboard;
